///\npub fn clamp(n: Float, min min_bound: Float, max max_bound: Float) -> Float {\n  n\n  |> min(max_bound)\n  |> max(min_bound)\n}\n\n/// Compares two `Float`s, returning an order.\n///\n/// ## Examples\n///    > compare(2.0, 2.3)\n///    Lt\n///\npub fn compare(a: Float, with b: Float) -> Order {\n  case a == b {\n    True -> order.Eq\n    False ->\n      case a <. b {\n        True -> order.Lt\n        False -> order.Gt\n      }\n  }\n}\n\n/// Compares two `Float`s, returning the smaller of the two.\n///\n/// ## Examples\n///\n///    > min(2.0, 2.3)\n///    2.0\n///\npub fn min(a: Float, b: Float) -> Float {\n  case a <. b {\n    True -> a\n    False -> b\n  }\n}\n\n/// Compares two `Float`s, returning the larger of the two.\n///\n/// ## Examples\n///\n///    > max(2.0, 2.3)\n///    2.3\n///\npub fn max(a: Float, b: Float) -> Float {\n  case a >. b {\n    True -> a\n    False -> b\n  }\n}\n\n/// Rounds the value to the next highest whole number as a `Float`.\n///\n/// ## Examples\n///\n///    > ceiling(2.3)\n///    3.0\n///\npub fn ceiling(float: Float) -> Float {\n  do_ceiling(float)\n}\n\nif erlang {\n  external fn do_ceiling(Float) -> Float =\n    "math" "ceil"\n}\n\nif javascript {\n  external fn do_ceiling(Float) -> Float =\n    "../gleam_stdlib.mjs" "ceiling"\n}\n\n/// Rounds the value to the next lowest whole number as a `Float`.\n///\n/// ## Examples\n///\n///    > floor(2.3)\n///    2.0\n///\npub fn floor(float: Float) -> Float {\n  do_floor(float)\n}\n\nif erlang {\n  external fn do_floor(Float) -> Float =\n    "math" "floor"\n}\n\nif javascript {\n  external fn do_floor(Float) -> Float =\n    "../gleam_stdlib.mjs" "floor"\n}\n\n/// Rounds the value to the nearest whole number as an `Int`.\n///\n/// ## Examples\n///\n///    > round(2.3)\n///    2\n///\n///    > round(2.5)\n///    3\n///\npub fn round(float: Float) -> Int {\n  do_round(float)\n}\n\nif erlang {\n  external fn do_round(Float) -> Int =\n    "erlang" "round"\n}\n\nif javascript {\n  fn do_round(float: Float) -> Int {\n    case float >=. 0.0 {\n      True -> js_round(float)\n      _ -> 0 - js_round(negate(float))\n    }\n  }\n\n  external fn js_round(Float) -> Int =\n    "../gleam_stdlib.mjs" "round"\n}\n\n/// Returns the value as an `Int`, truncating all decimal digits.\n///\n/// ## Examples\n///\n///    > truncate(2.4343434847383438)\n///    2\n///\npub fn truncate(float: Float) -> Int {\n  do_truncate(float)\n}\n\nif erlang {\n  external fn do_truncate(Float) -> Int =\n    "erlang" "trunc"\n}\n\nif javascript {\n  external fn do_truncate(Float) -> Int =\n    "../gleam_stdlib.mjs" "truncate"\n}\n\n/// Returns the absolute value of the input as a `Float`.\n///\n/// ## Examples\n///\n///    > absolute_value(-12.5)\n///    12.5\n///\n///    > absolute_value(10.2)\n///    10.2\n///\npub fn absolute_value(float: Float) -> Float {\n  case float >=. 0. {\n    True -> float\n    _ -> 0. -. float\n  }\n}\n\n/// Returns the results of the base being raised to the power of the\n/// exponent, as a `Float`.\n///\n/// ## Examples\n///\n///    > power(2.0, 2.0)\n///    4.0\n///\n///    > power(8.0, 1.5)\n///    22.627416997969522\n///\npub fn power(base: Float, exponent: Float) -> Float {\n  do_power(base, exponent)\n}\n\nif erlang {\n  external fn do_power(Float, Float) -> Float =\n    "math" "pow"\n}\n\nif javascript {\n  external fn do_power(Float, Float) -> Float =\n    "../gleam_stdlib.mjs" "power"\n}\n\n/// Returns the square root of the input as a `Float`.\n///\n/// ## Examples\n///\n///    > square_root(4.0)\n///    Ok(2.0)\n///\n///    > square_root(-16.0)\n///    Error(Nil)\n///\npub fn square_root(number: Float) -> Result(Float, Nil) {\n  case number <. 0.0 {\n    True -> Error(Nil)\n    False -> Ok(power(number, 0.5))\n  }\n}\n\n/// Returns the negative of the value provided.\n///\n/// ## Examples\n///\n///    > negate(1.)\n///    -1.\n///\npub fn negate(x: Float) -> Float {\n  -1. *. x\n}\n\n/// Sums a list of `Float`s.\n///\n/// ## Example\n///\n///    > sum([1.0, 2.2, 3.3])\n///    6.5\n///\npub fn sum(numbers: List(Float)) -> Float {\n  numbers\n  |> do_sum(0.0)\n}\n\nfn do_sum(numbers: List(Float), initial: Float) -> Float {\n  case numbers {\n    [] -> initial\n    [x, ..rest] -> do_sum(rest, x +. initial)\n  }\n}\n\n/// Multiplies a list of `Float`s and returns the product.\n///\n/// ## Example\n///\n///    > product([2.5, 3.2, 4.2])\n///    33.6\n///\npub fn product(numbers: List(Float)) -> Float {\n  case numbers {\n    [] -> 0.\n    _ -> do_product(numbers, 1.)\n  }\n}\n\nfn do_product(numbers: List(Float), initial: Float) -> Float {\n  case numbers {\n    [] -> initial\n    [x, ..rest] -> do_product(rest, x *. initial)\n  }\n}\n'},1894:(e,t,n)=>{n.r(t),n.d(t,{default:()=>o});const o="import gleam/map.{Map}\nimport gleam/result\nimport gleam/list\n\nif erlang {\n  // A list is used as the map value as an empty list has the smallest\n  // representation in Erlang's binary format\n  type Token =\n    List(Nil)\n\n  const token = []\n}\n\nif javascript {\n  type Token =\n    Nil\n\n  const token = Nil\n}\n\n/// A set is a collection of unique members of the same type.\n///\n/// It is implemented using the `gleam/map` module, so inserts and lookups have\n/// logarithmic time complexity.\n///\npub opaque type Set(member) {\n  Set(map: Map(member, Token))\n}\n\n/// Creates a new empty set.\n///\npub fn new() -> Set(member) {\n  Set(map.new())\n}\n\n/// Gets the number of members in a set.\n///\n/// This function runs in constant time.\n///\n/// ## Examples\n///\n///    > new() |> insert(1) |> insert(2) |> size\n///    2\n///\npub fn size(set: Set(member)) -> Int {\n  map.size(set.map)\n}\n\n/// Inserts an member into the set.\n///\n/// This function runs in logarithmic time.\n///\n/// ## Examples\n///\n///    > new() |> insert(1) |> insert(2) |> size\n///    2\n///\npub fn insert(into set: Set(member), this member: member) -> Set(member) {\n  Set(map: map.insert(set.map, member, token))\n}\n\n/// Checks whether a set contains a given member.\n///\n/// This function runs in logarithmic time.\n///\n/// ## Examples\n///\n///    > new() |> insert(2) |> contains(2)\n///    True\n///\n///    > new() |> insert(2) |> contains(1)\n///    False\n///\npub fn contains(in set: Set(member), this member: member) -> Bool {\n  set.map\n  |> map.get(member)\n  |> result.is_ok\n}\n\n/// Removes a member from a set. If the set does not contain the member then\n/// the set is returned unchanged.\n///\n/// This function runs in logarithmic time.\n///\n/// ## Examples\n///\n///    > new() |> insert(2) |> delete(2) |> contains(1)\n///    False\n///\npub fn delete(from set: Set(member), this member: member) -> Set(member) {\n  Set(map: map.delete(set.map, member))\n}\n\n/// Converts the set into a list of the contained members.\n///\n/// The list has no specific ordering, any unintentional ordering may change in\n/// future versions of Gleam or Erlang.\n///\n/// This function runs in linear time.\n///\n/// ## Examples\n///\n///    > new() |> insert(2) |> to_list\n///    [2]\n///\npub fn to_list(set: Set(member)) -> List(member) {\n  map.keys(set.map)\n}\n\n/// Creates a new set of the members in a given list.\n///\n/// This function runs in loglinear time.\n///\n/// ## Examples\n///\n///    > import gleam/list\n///    > [1, 1, 2, 4, 3, 2] |> from_list |> to_list |> list.sort\n///    [1, 3, 3, 4]\n///\npub fn from_list(members: List(member)) -> Set(member) {\n  let map =\n    list.fold(\n      over: members,\n      from: map.new(),\n      with: fn(m, k) { map.insert(m, k, token) },\n    )\n  Set(map)\n}\n\n/// Combines all entries into a single value by calling a given function on each\n/// one.\n///\n/// Sets are not ordered so the values are not returned in any specific order.\n/// Do not write code that relies on the order entries are used by this\n/// function as it may change in later versions of Gleam or Erlang.\n///\n/// # Examples\n///\n///    > from_list([1, 3, 9])\n///    > |> fold(0, f